import React from "react";
import { Link } from 'react-router-dom'
import MenuBar from '../../components/MenuBar'
import Footer from "../../components/Footer";

function Community({ location, history }) {
    return (
        <>
        <div className="App">
          <MenuBar></MenuBar>
          <div className="IntroBtnDiv" id="1">
          <p className="IntroMoveText">이곳은 <strong>나아라</strong>의 <strong>커뮤니티</strong>입니다!</p>
          <Link to="/consulting">
            <button className="IntroMoveBtn" href="/newtest">질문게시판</button>
          </Link>
          <Link to="/question">
            <button className="IntroMoveBtn" href="/newtest">상담게시판</button>
          </Link>

        </div>

        <Footer></Footer>
        </div>
        </>
    );
}

export default Community;
